function getDevIconComponent<T extends string>(
	string: T,
): Option.Option<(props: ComponentPropsWithoutRef<'svg'>) => ReactComponentElement<'svg'>> {
	type IconKey = keyof typeof DevIconRecord
	const keys = Object.keys(DevIconRecord) as readonly IconKey[]
	const matchingKeys = new Set<IconKey>()
	for (const key of keys) {
		if (string.toLowerCase().trim().split(' ').join('').includes(key)) {
			matchingKeys.add(key)
		}
	}
	let longestMatchingKey: Option.Option<IconKey> = Option.none()
	if (matchingKeys.size) {
		longestMatchingKey = Option.some(
			Array.from(matchingKeys).reduce((a, b) => (a.length > b.length ? a : b)),
		)
	}

	return Option.map(longestMatchingKey, key => DevIconRecord[key])
}
